import {Container} from 'react-bootstrap';
import Footer from './Conponents/Footer';
import Header from './Conponents/Header';
import HomeScreen from './Screens/HomeScreen';

function App() {
  return (
    <main>
      <Header />
      <Container>
        <HomeScreen />
      </Container>
      <Footer />
    </main>
    );
}

export default App;
